import React from "react";
import { IoNotifications } from "react-icons/io5";
import { RiSettingsFill } from "react-icons/ri";
import { ChevronDownIcon } from "@heroicons/react/20/solid";
// import { Fragment } from "react";
import { Popover } from "@headlessui/react";

export default function Header() {
  return (
    <div className="m-2 px-4 bg-white h-16 rounded-md flex justify-between items-center">
      <div className="">Tab Title</div>
      <div className="">
        <div className="flex items-center gap-2">
          <Popover className="relative">
            {({ open }) => (
              <>
                <Popover.Button
                  className={`
                ${open ? "text-white" : "text-white/90"}
                group inline-flex items-center rounded-md bg-orange-700 px-3 py-2 text-base font-medium hover:text-white focus:outline-none focus-visible:ring-2 focus-visible:ring-white/75`}
                >
                  <RiSettingsFill fontSize={20} />

                  <ChevronDownIcon
                    className={`${
                      open ? "text-orange-300" : "text-orange-300/70"
                    }
                  ml-2 h-5 w-5 transition duration-150 ease-in-out group-hover:text-orange-300/80`}
                    aria-hidden="true"
                  />
                </Popover.Button>
              </>
            )}
          </Popover>
          <div className="hover:bg-[#EBE9F6] duration-500 p-2 rounded-md cursor-pointer">
            <IoNotifications fontSize={20} />
          </div>
          <div className="hover:bg-[#EBE9F6] duration-500 p-2 rounded-md cursor-pointer">
            <RiSettingsFill fontSize={20} />
          </div>
          <div className=""></div>
        </div>
      </div>
    </div>
  );
}
